import React, { Component } from 'react';
import logo from './zyinno.png';
import './home.css'


//定义一个React组件
class ZYHome extends Component {
  render() {  //React组件中必须有一个render函数
    return (
      <div>
        <div className="ZY-top">
        <img src={logo} className="ZY-logo" alt="logo" />
        <ul>
          <li><a href="/about/viewCategoryPage?categoryId=108" target="_self" title="公司业务">
              关于智宇
              </a>
          </li>
          <li>智宇未来</li>
          <li>产品介绍</li>
          <li>服务对象</li>
        </ul>
        </div>

        <div>智宇创新2</div>
        <div>智宇创新3</div>
      </div>
    );
  }
}

export default ZYHome; //组件定义好之后，导出了在别的地方才能引用
